import React from 'react';
import { Box, Container, Typography, Grid, Card, CardContent, CardActions, Button } from '@mui/material';
import GitHubIcon from '@mui/icons-material/GitHub';
import LaunchIcon from '@mui/icons-material/Launch';

const Projects = () => {
  const projects = [
    {
      title: 'Conv-AI Medical Chatbot',
      description: 'A conversational AI chat-bot aiming to provide diagnoses for less privileged society developed by Finetuning LLM\'s such as Llama, GPT.',
      github: 'https://github.com/your-username/project1',
      demo: 'https://demo-link.com',
    },
    {
      title: 'Clinical Text Summarizer',
      description: 'A Large Language Model Fine-tuned to perform the task of Text Summarization of clinical history of patients, contrasted by the efficiencies of LSTM and BERT.',
      github: 'https://github.com/your-username/project2',
      demo: 'https://demo-link.com',
    },
    {
      title: 'Single Image Super Resolution',
      description: 'A GAN Model developed to enhance the quality of degraded images by an upscaling factor of 4, contrasted by the performance of CNN and image interpolation.',
      github: 'https://github.com/your-username/project3',
      demo: 'https://demo-link.com',
    },
  ];

  return (
    <Box
      id="projects"
      sx={{
        py: 8,
        backgroundColor: 'background.default',
      }}
    >
      <Container>
        <Typography
          variant="h2"
          sx={{
            mb: 6,
            textAlign: 'center',
            color: 'text.primary',
          }}
        >
          Projects
        </Typography>
        <Grid container spacing={4}>
          {projects.map((project, index) => (
            <Grid item xs={12} md={4} key={index}>
              <Card
                sx={{
                  height: '100%',
                  display: 'flex',
                  flexDirection: 'column',
                  backgroundColor: 'background.paper',
                  transition: 'transform 0.2s',
                  '&:hover': {
                    transform: 'translateY(-5px)',
                  },
                }}
              >
                <CardContent sx={{ flexGrow: 1 }}>
                  <Typography variant="h5" color="primary" gutterBottom>
                    {project.title}
                  </Typography>
                  <Typography variant="body1" color="text.primary">
                    {project.description}
                  </Typography>
                </CardContent>
                <CardActions>
                  <Button
                    startIcon={<GitHubIcon />}
                    href={project.github}
                    target="_blank"
                    rel="noopener noreferrer"
                  >
                    Github
                  </Button>
                  <Button
                    startIcon={<LaunchIcon />}
                    href={project.demo}
                    target="_blank"
                    rel="noopener noreferrer"
                  >
                    Live Demo
                  </Button>
                </CardActions>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Container>
    </Box>
  );
};

export default Projects;
